import { Container } from 'reactstrap';
import HeaderAgain from './common/HeaderAgain';
import Footer from './common/Footer';

const Again = (props) => {
  return(
    <>
      <Container className="p-4 bg blue">
        <HeaderAgain />
        <Footer />
      </Container>
    </>
  );
}

export default Again;
